    authDomain: "sdhacks-2021-20e65.firebaseapp.com",
    projectId: "sdhacks-2021-20e65",
    storageBucket: "sdhacks-2021-20e65.appspot.com",
    messagingSenderId: "717328057069",
    appId: "1:717328057069:web:7fe93d363dfbc9647cc2e4",
    measurementId: "G-PZYS8DEYJJ"
  }
);




ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

export default firebase;
